import React from 'react';
import { NextSeo } from 'next-seo';
 
export default (props) => {
    const {attr} = props;
    
  return(
  <>
    <NextSeo
      title={attr.title}
      description={attr.description}
      canonical={attr.canonical}
    />
  </>
  )
};
